import React, { Component } from 'react';
import "./about.css"

class Contact extends Component {
   
    render() {
        return (
            <div className="contact">
              <h2>Contact</h2>
              <p> This page consists of contact details.</p>
               <h4> Project Manager : Jad abboud </h4>
               <h4> Email Id        :jad-abboud@live.com </h4>
              
              <h2> Team members</h2>
              <p> Name        : JIANG Jichen</p>
              <p> Email Id    : jjcessica@hotmail.com</p>

              
              <p> Name        : Sravan nalalla</p>
              <p> Email Id    : nsravan@gmail.com</p>

              <p> Name        : ralph rezkallah</p>
              <p> Email Id    : ralph.rezkallah@outlook.com</p>

              
            </div>
        );
    }
}

export default Contact;
